import React from "react";
import { StyleSheet, css } from "aphrodite";

const Header = () => {
	return <div className={css(classes.header)}>Hello</div>;
};

const classes = StyleSheet.create({
	header: {
		display: "flex",
		flexDirection: "row",
		justifyContent: "space-evenly",
		color: "white",
        borderColor: "#1C1B1B"
	},
});

export default Header;
